import { UlShowcase } from "./style";

export const ShowCaseUl = ({ products }) => {
  return (
    <UlShowcase>
      {products.length &&
        products.map((cards) => {
          return (
            <li>
              <figure>
                <img src={cards.img} alt="" />
              </figure>

              <div className="content">
                <h3>{cards.name}</h3>
                <span className="type">{cards.category}</span>
                <p>{`R$ ${cards.price}`}</p>
              </div>
            </li>
          );
        })}
    </UlShowcase>
  );
};
